import { FAQsSection } from "../Component/FaqsPage/FAQsSection"
import { InstructorsSection } from "../Component/FaqsPage/InstructorsSection"
import { Box } from '@mui/material';

export const Movie=()=>{
    return (
      <>
         <Box sx={{ mb: 5, px: 3 }}> {/* Example: margin-bottom 5, padding-left and right 3 */}
        <FAQsSection />
      </Box>
        <InstructorsSection/>
      </>
    )
}
